export class Dropdwon extends React.Component {
    public state = {};

    public render() {
        return (
            <div className="dropdown">
                <button className="dropdown-button">Dropdown</button>
                <div className="dropdown-content">
                    <a href="#">HTML</a>
                    <a href="#">CSS</a>
                    <a href="#">JAVA</a>
                    <a href="#">C++</a>
                </div>
            </div>
        );
    }
}
